import React from 'react';
import './App.css'; 
import logout from './logout.svg'
import {useNavigate} from "react-router-dom"

function NamedAnnotation() {
    return (
        <div className="container">
            <Header />
            <MainContent />
        </div>
    );
}

function Header() {
    const navigate = useNavigate();
    const HandleLogout=()=>{ 
        alert('Logginng out')
        navigate('/login')
    }

    return (
        <header className="header">
        <nav className="nav-links">
          <a href="#">Home</a>
          <a href="#">About Us</a>
          <a href="#">Refresh</a>
          <a href="#">Performance</a>
          <a href="#">Report Bug</a>
        </nav>

        <div className="logout-button" onClick={() => HandleLogout() }>
          <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="logout-icon">
            <path d="M9 21H5a2 2 0 0 1-2-2V5a2 2 0 0 1 2-2h4"/>
            <polyline points="16 17 21 12 16 7"/>
            <line x1="21" y1="12" x2="9" y2="12"/>
          </svg>
        </div>
      </header>
    );
}

function MainContent() {
    return (
        <main className="main-content">
            <Method/>
            <UserInfo />
            <TaggingSection />
            <TagList />
        </main>
    );
}

function Method(){
    return (
    <div className="tagging-section">
    <div>
    <label>Method</label>
    <select>
        <option>Named Entity Recognition (NER)</option>
        <option>Sentimental Analysis</option>
        <option>Part Of Speech (POS)</option>
    </select>
</div>
</div>
)
}

function UserInfo() {
    return (
        <div className="user-info">
            <p>Current User: Siaesh Gaonkar</p>
        </div>
    );
}

function TaggingSection() {
    return (
        <div className="tagging-section">
            <div className="tagging-header">
                <div>
                    <label>language</label>
                    <select>
                        <option>Konkani</option>
                        <option>English</option>
                        <option>Hindi</option>
                    </select>
                
                </div>
                <div>
                    <label>Method</label>
                    <select>
                        <option>CLIFT NER</option>
                        <option>Method 2</option>
                    </select>
                
                </div>
            </div>
            <div className="textareas" rows="10" cols="50">
                <textarea className='text-2'>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Dolore culpa vitae ipsum ut repellat animi, consequatur maiores voluptatum corrupti quod quidem dolores voluptates tempora quia et, eveniet deleniti! Modi rerum soluta facilis ipsa atque odio ipsum iure quam voluptatem odit. Illum, minima accusantium ducimus modi molestiae iusto? Voluptas, eum minima voluptatum dolorem vitae distinctio voluptate similique recusandae quia magnam error odit asperiores sit maiores vel sunt qui? Cumque obcaecati laboriosam enim deleniti, earum at non atque error quaerat, molestias fugit labore quo quia sequi, provident ab amet consectetur? Dolorum distinctio possimus eaque ducimus eum asperiores dolor laudantium culpa ea pariatur? Non molestias fugit ab impedit ex deleniti itaque magnam enim esse! Dicta optio ad incidunt ipsa odio maxime, obcaecati impedit reiciendis unde earum alias facilis excepturi porro laboriosam eius at aperiam quod sunt. Molestias omnis nobis aliquam eius assumenda sint doloribus, alias ratione eum dignissimos. Quibusdam laborum doloremque quaerat at. Aliquam neque eveniet autem facilis ducimus at, voluptate beatae corrupti debitis nisi reprehenderit tenetur facere cumque, quos soluta totam ad ratione. Est tenetur ipsa, possimus nulla nemo minus illo id praesentium aliquid cum dolorem sed dignissimos, magnam recusandae eaque repellendus officia quae natus doloribus! Perspiciatis labore voluptate tenetur. Maxime hic quod rem debitis, impedit blanditiis fuga voluptatem rerum obcaecati iure exercitationem nulla eaque saepe animi, inventore, vel consequatur aspernatur sunt atque est. Est tenetur accusamus fuga quas, ad ex assumenda? Accusantium aliquam similique soluta veniam fuga libero, harum labore repudiandae hic iusto necessitatibus aut reprehenderit vero nam nulla quae, illo repellat optio ducimus non adipisci beatae ipsam. Perferendis esse mollitia nam, obcaecati odio illum quibusdam maxime expedita quam quisquam iste illo odit iusto aperiam id consequatur possimus itaque eum. Obcaecati placeat quas minima quos assumenda cum sit rerum eos quasi? Aliquam omnis excepturi dignissimos voluptate maiores unde sunt perferendis dicta.</textarea>
            </div>
            
            <div className="buttons">
                <button>Clear Tag</button>
                <button>Preview</button>
                <button>Next</button>
                <button className="tag-sentence">Tag Sentence</button>
                <button className="save">Save</button>
            </div>
        </div>
    );
}

function TagList() {
    const tags = [
        { text: 'Person', color: 'tag-green' },
        { text: 'Noun', color: 'tag-blue' },
        { text: 'Festival', color: 'tag-orange' },
        { text: 'Language', color: 'tag-red' },
        { text: 'Religion', color: 'tag-teal' },
        { text: 'Game', color: 'tag-yellow' },
        { text: 'Doubt', color: 'tag-light-yellow' },
        { text: 'Literature', color: 'tag-purple' },
        { text: 'B-Person', color: 'tag-dark-yellow' },
        { text: 'B-Noun', color: 'tag-dark-blue' },
        { text: 'B-Festival', color: 'tag-dark-orange' },
        { text: 'B-Language', color: 'tag-dark-red' },
        { text: 'B-Religion', color: 'tag-dark-teal' },
        { text: 'B-Game', color: 'tag-dark-yellow' },
        { text: 'Person', color: 'tag-green' },
        { text: 'Noun', color: 'tag-blue' },
        { text: 'Festival', color: 'tag-orange' },
        { text: 'Language', color: 'tag-red' },
        { text: 'Religion', color: 'tag-teal' },
        { text: 'Game', color: 'tag-yellow' },
        { text: 'Doubt', color: 'tag-light-yellow' },
        { text: 'Literature', color: 'tag-purple' },
        { text: 'B-Person', color: 'tag-dark-yellow' },
        { text: 'B-Noun', color: 'tag-dark-blue' },
        { text: 'B-Festival', color: 'tag-dark-orange' },
        { text: 'B-Language', color: 'tag-dark-red' },
        { text: 'B-Religion', color: 'tag-dark-teal' },
        { text: 'B-Game', color: 'tag-dark-yellow' },
    ];

    return (
        <div className="tag-list"><p>Tag legends</p>
            <div className="tags">
                {tags.map((tag, index) => (
                    <span key={index} className={`tag ${tag.color}`}>
                        {tag.text}
                    </span>
                ))}
            </div>
        </div>
    );
}

export default NamedAnnotation;
